 ('1', '1', 'nl', NULL, NULL, NULL, NULL, NULL, 'center', NULL, NULL, NULL, NULL, '2018-02-20 09:10:16', '2018-03-09 14:30:55', '3d1c7c19-948b-420c-a452-c2c408abe7dd'),
 ('2', '2', 'nl', 'BiglionPromotions', '<p><strong>We of Big Lion Promotions, believe in the power of live music. We stand for positivity, equality and love, and so we are promoting and supporting bands, artist and event-organizers who want to bring forth that same message.</strong></p>\r\n<p>Music has always been one of the most powerful tools to spread messages, we believe in the positive message which our bands and artists bring forth. We want to make it easy for events to find and program exiting and professional bands with a positive message. We also don\'t want bands and artists to spend time thinking about their promotion and/or live-shows while they really should spend that time on making new music. We, Big Lion Promotions, take care of those things in a professional way. </p>\r\n<p>Let the artist play!</p>\r\n<p>Let the organizer organise! </p>', NULL, NULL, NULL, 'center', NULL, NULL, NULL, NULL, '2018-02-20 09:10:18', '2018-03-17 14:57:18', '28544d7d-84dc-44da-a6d0-84e48bcdfc99'),
 ('4', '4', 'nl', 'contact', NULL, NULL, NULL, NULL, 'center', NULL, NULL, NULL, NULL, '2018-02-20 09:11:22', '2018-02-20 09:11:22', 'd3fce3f6-8449-448a-b5e8-cca4aed82d94'),
