 ('12', '12', 'nl', 'Reggae Night', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', NULL, NULL, NULL, 'top', NULL, NULL, NULL, NULL, '2018-02-21 08:32:39', '2018-02-22 16:17:39', '9a86ab7f-5ca8-4bdf-ac45-d153322aba27'),
 ('13', '13', 'nl', 'Jam around the world!', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', NULL, NULL, NULL, 'top', NULL, NULL, 'bqlhSF1hlsw', NULL, '2018-02-21 08:33:01', '2018-02-24 16:38:14', '61fe0769-b385-4d97-ba32-37b6171b5125'),
 ('14', '14', 'nl', 'Ziggy Marley Ziggodome', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', NULL, NULL, NULL, 'top', NULL, NULL, 'w63Jf-EYiNI', '', '2018-02-21 08:33:20', '2018-03-15 19:51:38', '8cc999a7-479d-4d0d-9f43-73343a74c45d'),
 ('20', '20', 'nl', 'Dilan Tekin', '<p>Dilan Tekin is a young and experienced guitar player, he is mostly known for his time\'s with Jah Reflection and OneWorldBand. He is known in the reggae-scene for his crazy chops and many live-effects. Besides that he also played with a lot of (female) singers in a unplugged set-up. At the moment he is performing with Faya-Milla &amp; The Lion Crew. You can hire this outstanding guitarist as stand-in musician, for acoustic and non-acoustic sets. </p><p><br />Do you want more info about Dilan Tekin or do you want to hire him for you\'re tour/recording-session/unplugged session? Contact Big Lion Promotions today!</p>', NULL, NULL, NULL, 'center', '[\"Gitarist\"]', NULL, '', '', '2018-02-21 10:36:36', '2018-03-17 15:43:22', 'ac13afb4-dcc7-403b-b4db-db55846b0977'),
 ('21', '21', 'nl', 'Faya-Milla', '<p>Faya-Milla is a well known and professional Reggae Dancehall singer from surinam. He has been around for a longtime, known for his work with WeeniemanSound and OneWorldBand. At this time he is the lead singer in Faya-Milla &amp; The Lion Crew. Faya-Milla can be booked with his band, or solo.</p>\r\n<div class=\"video-container\"></div>', NULL, NULL, NULL, 'center', '[\"Zanger\"]', NULL, 'Sl61_4lghNE', '', '2018-02-21 10:36:53', '2018-03-16 11:12:37', 'edfedd57-b4fc-4e55-882b-165c9c06a28f'),
 ('22', '22', 'nl', 'Remco Hoeneveld', '<p><strong>Lorem ipsum</strong>. L <strong>Lorem ipsum</strong> dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem. Nulla consequat massa quis enim. Donec</p>', NULL, NULL, NULL, 'center', '[\"Producer\"]', NULL, '', '', '2018-02-21 10:37:06', '2018-03-15 19:54:40', 'e781fec5-c814-49ab-bcd6-3ff6bde860f1'),
 ('23', '23', 'nl', 'backline', '<p>Besides bands and artists we also provide a complete backline if necessary. This is a professional backline fit for a 300 men crowd. You can book the backline with or without a sound-engineer, this way we make it easy for you to organise you\'re event. You can hire just the backline, or you can take a band and the backline, how big do you want you\'re event to be? That is up to you!</p>', 'Besides the backline it is also possible to book a band or artist for you\'re event. You\'re whole event could be on this site! ', 'For just the backline, you can mail and ask biglionpromotions for a quotation, prices will differ cause of distance and duration of the event.', 'The most profitable deal you can make, with hiring the backline and booking a band you\'l reduce travel costs. ', 'center', NULL, NULL, NULL, NULL, '2018-02-21 14:36:33', '2018-03-18 13:21:30', '3a0fe434-11ea-4401-ba3d-2e779868ca9e'),
 ('28', '28', 'nl', 'Dilan', NULL, NULL, NULL, NULL, 'center', NULL, NULL, NULL, NULL, '2018-02-21 15:43:06', '2018-02-21 15:43:06', '73a78e76-75f0-4fe0-9bf5-8641c07bfa5b'),
