 ('72', '72', 'nl', 'Faya-Milla & The Lion Crew', '<p>After the break-up of the famous OneWorldBand. The singer, guitarist, and key player, decided that their time wasn\'t over yet. And so they began a new group called Faya-Milla &amp; The Lion Crew. The combination of their talent and experience promises a lot of good to come for the reggae scene in holland. There new album is set to release in April 2018. And so their album tour will be planned in the spring and summer of 2018. Do you want more info about this band or book this band for you\'re event? Contact BigLionPromotions Today!</p>\r\n<div class=\"video-container\"><a href=\"https://www.youtube.com/watch?v=w5q9aZ3TRHo\">Faya-Milla &amp; The Lion Crew</a></div>', NULL, NULL, NULL, 'center', '[\"Gitarist\"]', '', 'bqlhSF1hlsw', '', '2018-03-10 12:22:45', '2018-03-16 12:21:17', 'ce89d80f-53cb-49e5-abdc-dc024d43970e'),
 ('73', '73', 'nl', 'Img 1097', NULL, NULL, NULL, NULL, 'center', '[\"Gitarist\"]', NULL, NULL, NULL, '2018-03-10 12:32:49', '2018-03-10 12:32:49', '15a8bce1-2250-48ee-9b13-c4f9255fe6dc'),
 ('74', '74', 'nl', 'Faya-Milla & The Lion Crew joins BigLionPromotions!', '<p>Just in! The very talented and promising reggae band The Lion Crew signed with BigLionPromotions! We are very happy to be working with one of the most talented group of the country! There album is set to release in April this year! And so there are some exiting times ahead of us!</p>\r\n<p>To give you a taste:</p>\r\n<div class=\"video-container\"></div>\r\n<div class=\"video-container\"></div>', NULL, NULL, NULL, 'center', '[\"Gitarist\"]', NULL, 'zgSr-kCqFhA', '', '2018-03-10 12:33:00', '2018-03-16 12:13:48', '960eff97-e34a-46ed-8f3a-a818efc223cb'),
 ('75', '75', 'nl', '28056670 1877371859221636 5421875706496978027 N', NULL, NULL, NULL, NULL, 'center', '[\"Gitarist\"]', NULL, NULL, NULL, '2018-03-10 13:04:21', '2018-03-10 13:04:21', '707739e9-f444-420d-893d-b78b2851e3ca'),
 ('76', '76', 'nl', 'Jah Reflection', '<p>Jah Reflection is a upcoming Reggae-band from Rotterdam. With 3 real queens leading the vocals and a real horn-section, this band brings a real unique, inspiring and happy experience to every show there playing. Jah Reflection already did some amazing shows and they will be continuing climbing to the top for sure! Want to get more info. about this band, or do you want to book them for you\'re event? Contact BigLionPromotions today!</p>\r\n<div class=\"video-container\"></div>', NULL, NULL, NULL, 'center', '[\"Gitarist\"]', '', 'X-6Kiewe1oc', '', '2018-03-10 13:04:41', '2018-03-16 12:19:27', '17e8919a-7e2a-424e-8fca-377a85b3ac8f'),
