 ('84', '84', 'nl', 'DJ Linnorass Irie ', '<p>DJ Linnorass Irie is a proffesional reggae DJ/Selecta from Arnhem! Known for his wide range of tunes this DJ is fit for every reggae/dancehall event. For in between bands, or for a solo set.  </p>\r\n<p>Do you want more info. or book DJ Linnorrass Irie? Contact Big Lion Promotions today and see what the options are!  </p>', NULL, NULL, NULL, 'center', '[\"Deejay\"]', NULL, '', '', '2018-03-16 12:41:45', '2018-03-16 12:42:42', '245e7aa0-e7f8-4464-a24d-caa24fb9368b'),
