 ('90', '90', 'nl', 'Dreadless', '<p>Dreadless is a successful and long-time running Reggae-band from Dordrecht! They have been playing with and for many singers: Tuff Lion, Harry Mo, Ras Iba, U-Brown and Anthony Johnson. Dreadless is without a doubt one of the most experienced bands on the biglionpromotions roster. </p>', NULL, NULL, NULL, 'center', '[\"Gitarist\"]', 'https://open.spotify.com/album/7rGYFs5giY2BuHAl6xwz5t?si=4Z0pLT0jT-aSL5C4d5p2dQ', 'BnA3oqMeYS0', '', '2018-03-16 12:48:57', '2018-03-16 12:53:38', '3029b6a0-20b8-40d4-afc2-23bef15b8e16'),
