 ('93', '93', 'nl', 'Bagjuice', '<p>Bagjuice is dub band form Amsterdam, there music is experimental and hard to describe. One thing is for sure though, they will turn it into a party! They have been on the scene quite some years now and not without succes. With two released EP\'s and shows all over Holland this band is making the way form something greater!</p>', NULL, NULL, NULL, 'center', '[\"Gitarist\"]', 'https://open.spotify.com/album/5ssdbcYucoE0IvEvOQaRse?si=s4-b-celRXKWMHXQDlYSzw', 'PdUyO9xOYJE', '', '2018-03-16 13:02:01', '2018-03-16 13:02:01', '58cf1af4-912f-44fc-bc52-9e1d479377f8'),
