 ('102', '102', 'nl', 'Premchand Mangal  ', '<p>Premchand is a professional producer and key player, at the moment he is performing with Faya-Milla &amp; The Lion Crew. Premchand has seen it all, as he played at zwarte cross, rastaplas, keti-koti, cannabis bevrijdingsdag festival, just to name a few. He is a musician with a ton of experience and one of the most wanted key players from Rotterdam. If that wasn\'t enough, Premchand is also a professional producer. We are proud to represent Premchand on the Big Lion Roster! </p>\r\n<p>Do you want more info about this amazing musician, or do you want to hire Premchand for a show, tour, recording session or as producer? Contact Big Lion Promotions today!</p>', NULL, NULL, NULL, 'center', '[\"Toetsenist\"]', NULL, 'm1im3PXkYbk', '', '2018-03-17 15:30:44', '2018-03-19 11:03:58', '784c54e5-13e9-4d28-ae0d-f1e8550eaba3'),
