 ('125', '93', '5', '1', 'nl', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Bagjuice\",\"slug\":\"bagjuice\",\"postDate\":1521205321,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"14\":\"\",\"9\":[\"92\"],\"15\":\"\",\"1\":\"<p>Bagjuice is dub band form Amsterdam, there music is experimental and hard to describe. One thing is for sure though, they will turn it into a party! They have been on the scene quite some years now and not without succes. With two released EP\'s and shows all over Holland this band is making the way form something greater!<\\/p>\",\"21\":\"\",\"19\":\"https:\\/\\/open.spotify.com\\/album\\/5ssdbcYucoE0IvEvOQaRse?si=s4-b-celRXKWMHXQDlYSzw\",\"2\":\"\",\"20\":\"PdUyO9xOYJE\"}}', '2018-03-16 13:02:01', '2018-03-16 13:02:01', '3805a682-fbeb-4de2-bca2-68a207fb69df'),
 ('126', '2', '1', '1', 'nl', '10', NULL, '{\"typeId\":null,\"authorId\":null,\"title\":\"Title\",\"slug\":\"homepage\",\"postDate\":1519117818,\"expiryDate\":null,\"enabled\":\"1\",\"parentId\":null,\"fields\":{\"1\":\"<p><strong>We of&nbsp;Big Lion Promotions, believe in the power of live music. We stand for positivity, equality and love,&nbsp;and so we are promoting and supporting bands, artist and event-organizers&nbsp;who want to bring forth that same&nbsp;message.<\\/strong><\\/p>\\r\\n<p>Music has always been one of the most powerful tools to spread messages, we believe in the positive message which&nbsp;our bands and artists bring forth. We want to make it easy for events to find and program exiting and&nbsp;professional bands with a positive message.&nbsp;We also&nbsp;don\'t want bands and artists to spend time thinking about their promotion and\\/or live-shows while they really should spend that time on making new music. We, Big Lion Promotions, take care of those things in a professional way.&nbsp;<\\/p>\\r\\n<p>Let the artist play!<\\/p>\\r\\n<p>Let the organizer organise!&nbsp;<\\/p>\",\"3\":[\"39\"]}}', '2018-03-17 14:55:07', '2018-03-17 14:55:07', '38a12e58-2da5-417a-a38d-30883253b56b');
