 ('129', '102', '3', '1', 'nl', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Prem \",\"slug\":\"prem\",\"postDate\":1521300643,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"12\":[\"72\"],\"8\":[\"94\"],\"13\":\"\",\"1\":\"<p>Premchand is a professional producer and key player, at the moment he is performing with Faya-Milla & The Lion Crew. Premchand has seen it all, as he played at zwarte cross, rastaplas, keti-koti, cannabis bevrijdingsdag festival, just to name a few. He is a musician with a ton of experience and one of the most wanted key players from Rotterdam. We are proud to represent Premchand on the Big Lion Roster!<\\/p><p>Do you want more info about this amazing musician, or do you want to hire Premchand for a show, tour or recording session? Contact Big Lion Promotions today!<\\/p>\",\"18\":[\"Toetsenist\"],\"21\":\"\",\"2\":[\"95\",\"96\",\"97\",\"86\",\"98\",\"99\",\"100\",\"101\"],\"20\":\"m1im3PXkYbk\"}}', '2018-03-17 15:30:44', '2018-03-17 15:30:44', '029debcf-8247-4e92-92a9-45802537b7e1'),
 ('130', '102', '3', '1', 'nl', '2', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Premchand Mengal  \",\"slug\":\"prem\",\"postDate\":1521300600,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"12\":[\"72\"],\"8\":[\"94\"],\"13\":\"\",\"1\":\"<p>Premchand is a professional producer and key player, at the moment he is performing with Faya-Milla & The Lion Crew. Premchand has seen it all, as he played at zwarte cross, rastaplas, keti-koti, cannabis bevrijdingsdag festival, just to name a few. He is a musician with a ton of experience and one of the most wanted key players from Rotterdam. If that wasn\'t enough, Premchand is also a professional producer.&nbsp;We are proud to represent Premchand on the Big Lion Roster!&nbsp;<\\/p>\\r\\n<p>Do you want more info about this amazing musician, or do you want to hire Premchand for a show, tour, recording session or as producer? Contact Big Lion Promotions today!<\\/p>\",\"18\":[\"Toetsenist\"],\"21\":\"\",\"2\":[\"95\",\"96\",\"97\",\"86\",\"98\",\"99\",\"100\",\"101\"],\"20\":\"m1im3PXkYbk\"}}', '2018-03-17 15:33:47', '2018-03-17 15:33:47', 'c4994db1-6fdc-45f2-99c2-366c92738fe1'),
 ('131', '20', '3', '1', 'nl', '7', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Dilan Tekin\",\"slug\":\"dilan-tekin\",\"postDate\":1519209360,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"12\":[\"72\"],\"8\":[\"103\"],\"13\":\"\",\"1\":\"<p>Dilan Tekin is a young and&nbsp;experienced guitar player, he is mostly known for his time\'s with Jah Reflection and OneWorldBand. He is known in the reggae-scene&nbsp;for his crazy chops and many live-effects.&nbsp;Besides that he also played with a lot of (female) singers in a unplugged set-up.&nbsp;At the moment he is performing with Faya-Milla & The Lion Crew. You can hire this outstanding guitarist as stand-in musician, for acoustic and non-acoustic sets.&nbsp;<\\/p><p><br>Do you want more info about Dilan Tekin or do you want to hire him for you\'re tour\\/recording-session\\/unplugged session? Contact Big Lion Promotions today!<\\/p>\",\"18\":[\"Gitarist\"],\"21\":\"\",\"2\":\"\",\"20\":\"\"}}', '2018-03-17 15:43:22', '2018-03-17 15:43:22', '09427077-50a1-484d-be63-fb20ea0e9f63'),
 ('132', '23', '9', '1', 'nl', '7', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"backline\",\"slug\":\"backline\",\"postDate\":1519223793,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"7\":[\"111\",\"112\",\"113\",\"114\",\"115\"],\"4\":\"Besides the backline it is also possible to book a band or artist for you\'re event. You\'re whole event could be on this site! \",\"6\":\"The most profitable deal you can make, with hiring the backline and booking a band you\'l reduce travel costs. \",\"5\":\"For just the backline, you can mail and ask biglionpromotions for a quotation, prices will differ cause of distance and duration of the event.\",\"1\":\"<p>Besides bands and artists we also provide a complete backline if necessary. This is a professional backline fit for a 300 men crowd. You can book the backline with or without a sound-engineer, this way we make it easy for you to organise you\'re event. You can hire just the backline, or you can take a band and the backline, how big do you want you\'re event to be? That is up to you!<\\/p>\",\"3\":[\"44\"],\"2\":\"\"}}', '2018-03-18 13:20:23', '2018-03-18 13:20:23', '3151c64a-5fc8-4a4d-a7fc-dc4b718e4c12'),
 ('133', '23', '9', '1', 'nl', '8', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"backline\",\"slug\":\"backline\",\"postDate\":1519223793,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"7\":[\"111\",\"112\",\"113\",\"114\",\"115\"],\"4\":\"Besides the backline it is also possible to book a band or artist for you\'re event. You\'re whole event could be on this site! \",\"6\":\"The most profitable deal you can make, with hiring the backline and booking a band you\'l reduce travel costs. \",\"5\":\"For just the backline, you can mail and ask biglionpromotions for a quotation, prices will differ cause of distance and duration of the event.\",\"1\":\"<p>Besides bands and artists we also provide a complete backline if necessary. This is a professional backline fit for a 300 men crowd. You can book the backline with or without a sound-engineer, this way we make it easy for you to organise you\'re event. You can hire just the backline, or you can take a band and the backline, how big do you want you\'re event to be? That is up to you!<\\/p>\",\"3\":[\"116\"],\"2\":\"\"}}', '2018-03-18 13:21:30', '2018-03-18 13:21:30', '2a28c913-a84a-4fcf-b936-1b2c361460b9'),
 ('134', '102', '3', '1', 'nl', '3', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Premchand Mangal  \",\"slug\":\"prem\",\"postDate\":1521300600,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"12\":[\"72\"],\"8\":[\"94\"],\"13\":\"\",\"1\":\"<p>Premchand is a professional producer and key player, at the moment he is performing with Faya-Milla & The Lion Crew. Premchand has seen it all, as he played at zwarte cross, rastaplas, keti-koti, cannabis bevrijdingsdag festival, just to name a few. He is a musician with a ton of experience and one of the most wanted key players from Rotterdam. If that wasn\'t enough, Premchand is also a professional producer.&nbsp;We are proud to represent Premchand on the Big Lion Roster!&nbsp;<\\/p>\\r\\n<p>Do you want more info about this amazing musician, or do you want to hire Premchand for a show, tour, recording session or as producer? Contact Big Lion Promotions today!<\\/p>\",\"18\":[\"Toetsenist\"],\"21\":\"\",\"2\":[\"95\",\"96\",\"97\",\"86\",\"98\",\"99\",\"100\",\"101\"],\"20\":\"m1im3PXkYbk\"}}', '2018-03-19 11:03:59', '2018-03-19 11:03:59', 'f9968bd6-7801-4e43-a6c9-77dc36584f6c');



